@default-afui-tabs-border: 0.5px solid rosybrown;

@default-afui-tabs-container-flex-direction: row;

@default-afui-tabs-tabs-flex-direction: column;
@default-afui-tabs-tabs-justify-content: space-between;
@default-afui-tabs-tab-margin: 0 0 2px 0;

@default-afui-tabs-content-background-color: var(--white);
@default-afui-tabs-content-padding: 20px 30px 20px 15px;
@default-afui-tabs-content-overflow: auto;

@default-afui-tabs-content-scrollbar-background-width: 16px;
@default-afui-tabs-content-scrollbar-thumb-background-clip: padding-box;
@default-afui-tabs-content-scrollbar-thumb-background-color: #dae1e8;
@default-afui-tabs-content-scrollbar-thumb-border: 7px solid rgba(0, 0, 0, 0);
@default-afui-tabs-content-scrollbar-thumb-border-radius: 10px;

@default-afui-tabs-padding-between-contents: 50px;

app-tabs {
  height: 100%;
  width: 100%;
  border: var(--afui-tabs-border, @default-afui-tabs-border);
  display: flex;

  .example-container {
    display: flex;
    flex-direction: var(
      --afui-tabs-container-flex-direction,
      @default-afui-tabs-container-flex-direction
    );
    direction: rtl;

    .tabs-container {
      flex: 1.25;
      display: flex;
      gap: 2px;
      flex-direction: var(
        --afui-tabs-tabs-flex-direction,
        @default-afui-tabs-tabs-flex-direction
      );
      justify-content: var(
        --afui-tabs-tabs-justify-content,
        @default-afui-tabs-tabs-justify-content
      );

      tab:not(:last-child) {
        margin: var(--afui-tabs-tab-margin, @default-afui-tabs-tab-margin);
      }

      & > * {
        height: 100%;
      }
    }

    .content-container {
      flex: 6;
      background-color: var(
        --afui-tabs-content-background-color,
        @default-afui-tabs-content-background-color
      );
      padding: var(
        --afui-tabs-content-padding,
        @default-afui-tabs-content-padding
      );
      overflow: var(
        --afui-tabs-content-overflow,
        @default-afui-tabs-content-overflow
      );

      section:not(:last-child) {
        padding-bottom: var(
          --afui-tabs-padding-between-contents,
          @default-afui-tabs-padding-between-contents
        );
      }

      &::-webkit-scrollbar {
        width: var(
          --afui-tabs-content-scrollbar-background-width,
          @default-afui-tabs-content-scrollbar-background-width
        );
      }

      &::-webkit-scrollbar-thumb {
        border: var(
          --afui-tabs-content-scrollbar-thumb-border,
          @default-afui-tabs-content-scrollbar-thumb-border
        );
        background-clip: var(
          --afui-tabs-content-scrollbar-thumb-background-clip,
          @default-afui-tabs-content-scrollbar-thumb-background-clip
        );
        border-radius: var(
          --afui-tabs-content-scrollbar-thumb-border-radius,
          @default-afui-tabs-content-scrollbar-thumb-border-radius
        );
        background-color: var(
          --afui-tabs-content-scrollbar-thumb-background-color,
          @default-afui-tabs-content-scrollbar-thumb-background-color
        );
      }
    }
  }
}

